COMENTÁRIOS - ESTUDO DE CASO

Seguem minhas “opiniões” sobre o tema proposto.
1. A análise da cinemática do trauma / biomecânica do trauma mostra uma agressão com arma branca com profundidade estimada de pelo menos 20 cm com objeto “incluso / cravado” no tórax;
2. A vítima apresenta parada cardiorrespiratória constatada na primeira avaliação efetuada por uma Equipe de Suporte Básico de Vida (SBV);
3. Ambulância de Suporte Básico de Vida  é composta de pelo menos 2 socorristas em nível  Técnico de Enfermagem (profissional oriundo da área de saúde) , Condutor Socorrista (profissional não oriundo da área de saúde) e, em vários locais do país, por leigos treinados não oriundos da área de saúde (bombeiros civis, bombeiros militares, dentre outros).  Essas classificações estão dispostas nas Portarias GM/MS nº 2.048/2002 e mesmo número 2048/2009), respectivamente “Regulamento Técnico Estadual  das Urgências “ e ”APH como componente do SUS – Sistema Único de Saúde”; 
4. Diante do exposto no item anterior é preciso ter muita cautela e responsabilidade na divulgação de assuntos relacionados a Atendimento Pré-hospitalar (APH) no Brasil, pois é um público com vastas diferenças de conhecimento técnico científico e responsabilidades legais perante o exercício da profissão;
5. O COFEN - Conselho Federal  de Enfermagem e os COREN – Conselhos Regionais de Enfermagem tem frequentemente por meio de portarias e resoluções regulamentado o Serviço de APH no Brasil traçando regramento para atuação do Técnico de Enfermagem e Enfermeiro. Os demais profissionais não possuem o mesmo amparo legal e administrativo por ausência de conselhos ou legislação específica;
6. Tecnicamente, diante de uma situação de parada cardíaca compete ao SBV executar procedimentos para ressuscitação cardiopulmonar (termo utilizado pela American Heart Association) com a aplicação de ciclos de compressões e ventilações de acordo com a respectiva faixa etária (30x2 nesse caso);
7. Os casos de “não ressuscitação” previstos em Manuais de Procedimentos Operacionais dos principais serviços de APH públicos e privados não contemplam a condição proposta;
8. As Diretrizes de Ressuscitação Cardiopulmonar e Atendimento Cardiovascular de Emergências da American Heart Association /ILCOR estabelece como referência de posicionamento das mãos para a compressão torácica a “metade inferior do esterno” ;
9. O Socorrista estará impedido de executar as compressões torácicas efetivas porque o objeto impede a colocação das mãos no ponto de referência;
10. Se colocar as mãos posicionadas fora do pontos de referência fará um procedimento sem nenhuma efetividade;
11. Há que se considerar que poderá haver risco pessoal  de sofrer lesão durante as compressões (corte na mão contaminado com sangue do paciente e seus respectivos riscos biológicos) e, por conseguinte, a biossegurança estará seriamente afetada e teremos mais uma vítima ;
12. A retirada de objeto cravado /incluso no corpo de uma vítima somente encontra respaldo nas referências bibliográficas quando está obstruindo as vias aéreas (engasgamento, por exemplo);
13. Existem 4 (quatro) tipos de parada cardíaca: Taquicardia Ventricular sem Pulso (TVSP) e Fibrilação Ventricular (FV) com tratamento primordial com desfibrilação cardíaca e/ou Atividade Elétrica sem Pulso (AESP) e Assistolia com tratamento primordial da causa e as medidas de Suporte Avançado de Vida (SAV) pré ou intra-hospitalar);
13.1. No caso em questão é mais provável a ocorrência de Assistolia ou AESP, não tratáveis com terapia de choque;
13.2. Provavelmente ocorreu Assistolia por exsanguinação (hemorragia interna torácica maciça produzida por lesão de grandes vasos (aorta, veia cava) ou Atividade Elétrica sem Pulso em decorrência de uma tamponamento cardíaco (lesão no ventrículo com hemorragia para o espaço pericárdico);
14. As “porcentagens de sobrevivência com alta hospitalar” de menos 10%” a cada minuto sem desfibrilação não se aplica ao caso em questão.
14.1. O emprego do Desfibrilador Externo Automático (DEA) não está indicado para vítimas de traumas (estude o assunto “DEA” antes de questionar esse ponto). DEA é indicado para parada cardíaca decorrente de emergências clínicas ou quando o socorrista tiver informações de que havia sinais e sintomas de uma emergência clínica que desencadeou o acidente que gerou o trauma (Exemplo: supostamente infartou e caiu da laje); 
15. A questão toda está na RETIRADA OU NÃO DO CORPO ESTRANHO DO LOCAL necessário para iniciar procedimentos efetivos de RCP;
15.1. Retirada de objetos inclusos / cravados no corpo nas condições propostas não faz parte do currículo do curso de formação ou especialização de socorristas em Nível Suporte Básico de Vida. Extrapola seus limites de atuação profissional e, portanto, pode (truncated)
